import logo from '../../assets/imgs/bold.png';

import './Header.css';
import Modal from '../Modal/Modal';
import { useState } from 'react';

function Header({ ...props }) {
	const [isOpen, setIsOpen] = useState(false);
	const [showLogin, setShowLogin] = useState(false);
	const [showSignup, setShowSignup] = useState(false);

	// const renderLogin = () => {
	// 	setLogin(!login);
	// };

	// const renderSignup = () => {
	// 	setLogin(prev => !prev);
	// };

	const closeModal = () => {
		setIsOpen(false);
	};

	const openModal = () => {
		if (showLogin || showSignup) {
			setIsOpen(true);
		}
	};

	return (
		<div className='Header'>
			<div className='header-brand'>
				<img className='header-logo' alt='logo' src={logo} />

				<h1 className='header-h1'> BiaNova </h1>
			</div>

			<div className='login'>
				<p>
					<button onClick={() => setShowLogin(true)} className='header-btn'>
						{' '}
						Log In{' '}
					</button>{' '}
					|{' '}
					<button onClick={() => setShowSignup(true)} className='header-btn'>
						{' '}
						Sign Up{' '}
					</button>
				</p>
			</div>
			{showLogin && <Modal showLogIn={showLogin} close={closeModal} />}
			{showLogin && <Modal showSignup={showSignup} close={closeModal} />}
		</div>
	);
}

export default Header;
